    max-height: 30px;
    font-size: 12px;
    font-weight: normal;
}

.react-grid-HeaderCell .Select-control {
    max-height: 30px;
    border: 1px solid #cccccc;
    color: #555;
    border-radius: 3px;
}

.react-grid-HeaderCell .is-focused:not(.is-open) > .Select-control {
