.react-grid-HeaderCell .Select-control .Select-placeholder {
    line-height: 20px;
    color: #999;
    padding: 4px;
}

.react-grid-HeaderCell .Select-control .Select-input {
    max-height: 28px;
    padding: 4px;
    margin-left: 0px
